    false,nt"url": null,nt"notes": "This narrative report for Okefenokee National
    Wildlife Refuge summarizes refuge activities from calendar year 1970.  The report
    begins with a summary of the weather and habitat conditions during the period.   Water
    conditions and food and cover are described in this summary.  Wildlife- including
    migratory birds, upland game birds, big game animals, fur animals, hawks, eagles
    and owls, other birds, fish, reptiles, and disease- is also covered.  The report
    includes a refuge development and maintenance section which discusses physical development,
    plantings, collections and receipts, control of vegetation, planned burning, and
    fires.  Resource development is outlined; topics include grazing, haying, fur harvest,
    timber removal, commercial fishing, and other uses.  A progress report on field
    investigations and applied research is also provided.  The public relations section
    of the report discusses recreational uses, refuge visitors, refuge participation,
    hunting, violations, and safety.  Items of interest, N-R forms, and photographs
    are provided at the end of the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
